import React from 'react';
import './home.css';  // 별도의 CSS 파일로 스타일링

const Home = () => {
  return (
    <div className="home-container">
      {/* 상단 로고 및 그룹 만들기 버튼 */}
      <header className="home-header">
        <h1>조각집</h1>
        <button className="create-group-button">그룹 만들기</button>
      </header>

      {/* 검색 및 필터 */}
      <div className="search-filter">
        <button className="filter-button">전체</button>
        <input type="text" className="search-input" placeholder="그룹명을 검색해주세요" />
        <button className="sort-button">정렬순</button>
      </div>

      {/* 그룹 목록 */}
      <div className="group-list">
        {Array(12).fill().map((_, index) => (
          <div key={index} className="group-card">
            <img src="https://via.placeholder.com/375x375" alt="그룹 대표 이미지" className="group-image" />
            <div className="group-info">
              <p>디데이: 245</p>
              <h3>에델바이스</h3>
              <p>새로 피어난 희망을 상징하는 아름다운 꽃</p>
              <div className="group-stats">
                <span>공감: 2</span>
                <span>추억: 8</span>
                <span>1.5K</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
